Current implementation of inverse power iteration in `EigenExecutionerBase` allows the eigenvalue and solution difference (both are postprocessors) to be evaluated on timestep_end. Essentially it allows using time step to mimic the iteration. This is ok most of times. But it requires the evaluation of aux kernels and UOs on timestep_end during power iteration. In complicated simulations, there could be aux kernels or UOs should be evaluated on timestep_end ONLY but not at each power iteration. So I plan:

1) ask the eigenvalue and solution difference always to be evaluated on linear;
2) get rid of all timestep calls;
3) manually copy their values to their old values (actually only the eigenvalue needs to be copied) at the end of each power iteration;
4) get rid of solution output during power iteration completely.

This will significantly simplify the implementation as well simplify the input syntax.

Some minor improvements can be made on the current input syntax, like:

1) change `output_on_final` to `output_before_normalization`;
2) make `xdiff` postprocessor only for InversePowerMethod;
3) add `output_after_power_iterations` in NonlinearEigen to enable outputs after initial free power iterations.

This will require regolding and patches in herd. But I think this is the right move.
We can always put eigenvalue and solution difference on step when exec_step is available in future.

